import React, { Component } from 'react'
import { Pagination } from 'antd';
export default class Paginations extends Component {
    render() {

        function showTotal(total) {
            return `Total ${total} items`;
        }
        return (
            <div>
                <Pagination
                    showSizeChanger
                    onShowSizeChange={onShowSizeChange}
                    defaultCurrent={3}
                    total={500}
                />
                <br />
                <Pagination
                    showSizeChanger
                    onShowSizeChange={onShowSizeChange}
                    defaultCurrent={3}
                    total={500}
                    disabled
                />
            </div>
        )
    }
}
